import Layout from '../../components/Layout';

export default function About() {

    let posts = [
        { id: 1, content: 'My day at the park' },
        { id: 2, content: 'Trip to the beach' }
    ]

    const postsList = posts.map((post) =>
        <li><a href="./">{ post.content }</a></li>
    );

    return (
        <Layout>
            <h1>Posts</h1>
            <ul>
                { postsList }
            </ul>
        </Layout>
    );
}
